packages/trevas.html.body:
Trevas
Utilisation
Télécharger la libraire sur npm :
yarn add @inseefr/trevas
Importer la fonction interpret :
import { interpret } from '@inseefr/trevas';

Exécuter l'interpretation VTL sur une expression :
const expr = '"Hello " || NAME';
const bindings = { NAME: 'world' };
const result = interpret(expr, bindings);
// result will be: 'Hello world'

packages/vtl-2.0-antlr-tools.html.body:
VTL 2.0 Antlr tools
Utilisation
Télécharger la libraire sur npm :
yarn add @inseefr/vtl-2.0-antlr-tools
Importer tous les outils :
import * as VTL20AntlrTools from '@inseefr/vtl-2.0-antlr-tools';

Ou importer les objets nécessaires directement un par un :
import {
    VtlLexer,
    VtlParser,
    VtlListener,
    VtlVisitor,
} from '@inseefr/vtl-2.0-antlr-tools';
